		"full_text": "하박국 (영기획 대표)\n\n“타워레코드, 파워스테이션, 부루의 뜨락, 향음악사, 퍼플레코드, 미화당, 시티비트, 상아레코드 등 음악 마니아가 모여드는 수입 음반 판매 가게들이 있었다. 중고등학교 때의 나는 매 주말마다 성남에서 8호선을 타고 명동, 신촌, 홍대로 향했다.” https://t.co/Wbhz8clHZO",
