		"text": "전자양 (전자양)\n\n“짧은 순간에 엄청난 충격을 받았어요. 동생과 저, 고등학교 1, 2학년 둘이 맨 앞에 앉아있었는데, 공간이 좁으니까 뮤지션이 바로 저희 앞에 있는 거예요. 그렇게 크라잉넛 공연도 보고 &lt;아워 네이션&gt; 1집을 사서 사인도 받고. 그때 처음으로 ‘나도 할 수 있겠다’는 생각을 했어요.” https://t.co/EuuofI2wct"
