		"text": "연진 (라이너스의 담요)\n\n“PC 통신의 세계에 들어갔더니 취향이 세부적으로 나뉘어서 각각의 소모임이 다 있는 거예요. 저는 콘을 좋아해서 콘 동호회를 따로 만들었고요. 동시에 라디오헤드 동호회에서 자료실 담당으로도 활동했어요. 이게 고2때쯤이었어요.” https://t.co/Al9SRdgN21"
